from math import isqrt
limit = 2000
s = set()
end = isqrt(limit)
for m in range(0, end+1):
    for k in range(m%2, end+1, 2):
        c = m**2*(k**2+1)
        if c > limit:
            break
        s.add(c)
print(sorted(s))

